import Header from "../components/Header";
import Footer from "../components/Footer";

import logo from "../images/logo.svg";

export default class HomePage extends Component {
  render() {
    return (
      <div>
        <Header />
        <img src={logo} className="App-logo" alt="logo" />
        <Footer />
      </div>
    );
  }
}
